<?phpnamespace Nemundo\Admin\Web;use Nemundo\Admin\AdminConfig;use Nemundo\Admin\Controller\AdminController;use Nemundo\Admin\Controller\AdminLanguageController;use Nemundo\Admin\Page\AdminNotFoundPage;use Nemundo\Core\Language\LanguageConfig;use Nemundo\Web\Base\AbstractWeb;use Nemundo\Web\WebConfig;class AdminWeb extends AbstractWeb{    public function loadWeb()    {        WebConfig::$notFoundPageClass = AdminNotFoundPage::class;        AdminConfig::$documentTitle = 'Admin';        if (LanguageConfig::$multiLanguage) {            AdminConfig::$webController = new AdminLanguageController();        } else {            AdminConfig::$webController = new AdminController();        }        AdminConfig::$userMode = true;        AdminConfig::$webController->render();    }}